@Component({
  selector: 'app-root',
  template: `
    <router-outlet></router-outlet>
  `,
  styles: [
    `
      :host {
        height: 100%;
        box-sizing: border-box;
        overflow: hidden;

        background-color: #2E3440;
      }
    `,
  ],
})
export class AppComponent { }
